import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import data from "./api";
import Questions from "./Questions";

function App() {



  return (
    <div className="App bg-success text-center">
      <div className="card m-lg-5 ">
        <div className="card-header">React Interview Questions</div>

        <div className="card-body">

          { data.map( ( item )=>{
            const {id} = item
            return <Questions key={id}{...item} ></Questions>
          })}
        </div>

      </div>
    </div>
  );
}
export default App;
